import{_ as e,c as a,o as l,ab as r}from"./chunks/framework.CUflZczI.js";const d=JSON.parse('{"title":"Готові апарати (Мультикоптер)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/complete_vehicles_mc/index.md","filePath":"uk/complete_vehicles_mc/index.md"}'),t={name:"uk/complete_vehicles_mc/index.md"},i=r('<h1 id="готові-апарати-мультикоптер" tabindex="-1">Готові апарати (Мультикоптер) <a class="header-anchor" href="#готові-апарати-мультикоптер" aria-label="Permalink to &quot;Готові апарати (Мультикоптер)&quot;">​</a></h1><p>Цей розділ містить інформацію про повністю зібрані готові до польоту (ГДП) або майже ГДП апарати, які мають PX4 за замовчуванням, або можуть використовуватися з PX4.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Це маленька підгрупа апаратів, які можуть працювати з PX4. Ви можете знайти інші на <a href="https://px4.io/ecosystem/commercial-systems/" target="_blank" rel="noreferrer">px4.io</a> і в <a href="./../airframes/airframe_reference.html">Посиланні на конструкції</a>.</p></div><h2 id="набори-для-розробки-дронів-посилання-на-платформи" tabindex="-1">Набори для розробки дронів/посилання на платформи <a class="header-anchor" href="#набори-для-розробки-дронів-посилання-на-платформи" aria-label="Permalink to &quot;Набори для розробки дронів/посилання на платформи&quot;">​</a></h2><p>Цей розділ містить перелік наборів дронів, які призначені як платформи для подальшого розвитку. Вони можуть бути як повністю зібраними, так і у частинах.</p><ul><li><a href="./../complete_vehicles_mc/modalai_starling.html">MODALAI VOXL 2 STARLING PX4 РОЗРОБКА ДРОНА</a> - ДРОН ДЛЯ РОЗРОБКИ SLAM, ПОТУЖЕНИЙ НАДМІЧКОЮ VOXL 2 ТА PX4.</li><li><a href="./../complete_vehicles_mc/px4_vision_kit.html">PX4 Vision DevKit</a> - Мультикоптер, що використовується для розробки комп&#39;ютерного зору PX4</li></ul><h2 id="попередньо-встановлении-px4" tabindex="-1">Попередньо встановлений PX4 <a class="header-anchor" href="#попередньо-встановлении-px4" aria-label="Permalink to &quot;Попередньо встановлений PX4&quot;">​</a></h2><p>У цьому розділі перелічені апарати, які продаються повністю зібраними та готові до польоту (ГДП), з встановленим PX4.</p><ul><li><a href="https://tealdrones.com/teal-one/" target="_blank" rel="noreferrer">Teal One</a></li><li><a href="./../complete_vehicles_mc/modalai_starling.html">ModalAI Starling</a></li><li><a href="https://www.modalai.com/sentinel" target="_blank" rel="noreferrer">ModalAI Sentinel</a></li><li><a href="./../complete_vehicles_mc/mindracer210.html">MindRacer 210</a></li><li><a href="./../complete_vehicles_mc/nanomind110.html">NanoMind 110</a></li></ul><h2 id="сумісні-з-px4" tabindex="-1">Сумісні з PX4 <a class="header-anchor" href="#сумісні-з-px4" aria-label="Permalink to &quot;Сумісні з PX4&quot;">​</a></h2><p>У цьому розділі перераховані апарати, де ви можете оновити програмне забезпечення для роботи з PX4.</p><ul><li><a href="./../complete_vehicles_mc/holybro_kopis2.html">Holybro Kopis 2</a></li><li><a href="./../complete_vehicles_mc/crazyflie21.html">Bitcraze Crazyflie 2.1</a></li><li><a href="./../complete_vehicles_mc/betafpv_beta75x.html">BetaFPV Beta75X 2S Brushless Whoop</a> (припинено)</li></ul><h2 id="кастомнии-px4" tabindex="-1">Кастомний PX4 <a class="header-anchor" href="#кастомнии-px4" aria-label="Permalink to &quot;Кастомний PX4&quot;">​</a></h2><p>У цьому розділі містяться користувацькі апарати, які працюють на <em>спеціалізованій</em> версії PX4 (підтримувані їхніми виробниками). Вони можуть бути оновлені або не оновлювальні для запуску &quot;ванільного&quot; PX4.</p><ul><li><a href="https://us.yuneec.com/typhoon-h-plus/" target="_blank" rel="noreferrer">Yuneec Typhoon H Plus</a></li><li><a href="https://px4.io/portfolio/yuneec-mantis-q/" target="_blank" rel="noreferrer">Yuneec Mantis Q</a></li><li><a href="https://px4.io/portfolio/yuneec-h520-hexacopter/" target="_blank" rel="noreferrer">Yuneec H520</a></li><li><a href="https://px4.io/portfolio/aerosense-aerobo/" target="_blank" rel="noreferrer">AeroSense Aerobo (AS-MC02-P)</a></li></ul><h2 id="дивіться-також" tabindex="-1">Дивіться також <a class="header-anchor" href="#дивіться-також" aria-label="Permalink to &quot;Дивіться також&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/kits.html">Комплекти (MC)</a></li><li><a href="./../frames_multicopter/diy_builds.html">DIY Збірки</a></li><li><a href="./../complete_vehicles_vtol/">Укомплектовані транспортні засоби (VTOL)</a></li><li><a href="./../complete_vehicles_fw/">Готові апарати (Fixed-Wing)</a></li></ul>',17),o=[i];function h(c,n,s,m,p,_){return l(),a("div",null,o)}const u=e(t,[["render",h]]);export{d as __pageData,u as default};
